import "./style.css";

function App() {
  const appTitle = "Today's Anime Note !!!";
  return (
    <>
      <header className="header">
        <div className="logo">
          <img src="logo.png" height="86" width="86" alt="Daily Anime Note!" />
          <h1>Today's Anime Note !!!</h1>
        </div>
        <button className="btn btn-large btn-open">SHARE A QUOTE</button>
      </header>

      <NewFactForm />
      <main className="main">
        <CategoryFilter />
        <FactList />
      </main>
    </>
  );
}

function NewFactForm() {
  return <form className="fact-form">Fact form</form>;
}

function CategoryFilter() {
  return <aside>Category filter</aside>;
}

function FactList() {
  return <section>section list</section>;
}

export default App;
